import React from 'react'
import { ArrowLeftOutlined } from '@ant-design/icons'
import { useDispatch, useSelector } from 'react-redux';
import SortableList from '../../Redux/Actions/SortableList'

const ProductEdit = () => {
    const dispatch = useDispatch()
    const ImageList = useSelector(state => state.SortableList.list)

    console.log(ImageList)
    const ClickBTN = () => ({
        orderList: ({ oldIndex, newIndex }) => {
            console.log('AppContainer OldIndex ==>', oldIndex)
            console.log('AppContainer NewIndex ==>', newIndex)
            dispatch(SortableList.orderList(oldIndex, newIndex))
        }
    })

    return (
        <div className='PE-container'>
            <div className='Nav'>
                <h2>Adidas Max Shoe</h2>
            </div>
            <div className='Sec-1'>
                <img className='CoverImage' src='https://media.gq-magazine.co.uk/photos/5edfa087310483753e788e82/master/w_1920,c_limit/20200609-adidas-11.jpg' alt='Cover Image' />
            </div>
            <div className='Sec-2'>
                <button onClick={() => ClickBTN}></button>
            </div>
        </div>
    )
}

export default ProductEdit
